<div class="panel-content">
<div class="wrap">
<header class="entry-header">
<h2 class="entry-title">O nas</h2>

</header><!-- .entry-header -->

<div class="entry-content">
<a id="onas" data-ps2id-target=""></a>
<hr />
<p style="text-align: left;">              <span style="font-family: arial, helvetica, sans-serif; font-size: 18pt;"> <span style="font-size: 14pt;">Jestesmy firma rodzinna, nasze meble goszcza w Panstwa domach juz od 27 lat . Specjalizujemy sie w produkcji mebli kuchennych.  Realizujemy takze indywidualne projekty: garderoby, zabudowy, szafy przesuwne itp.</span></span></p>
<p style="text-align: left;"><span style="font-family: arial, helvetica, sans-serif; font-size: 14pt;">               Nasze wieloletnie doswiadczenie pozwala sprostac oczekiwaniom nawet najbardziej wymagajacych klientow. Spelniamy Panstwa marzenia o oryginalnym wnetrzu.</span></p>
<hr />
<p>&nbsp;</p>
<a id="sklep" data-ps2id-target="Sklep"></a>
</div><!-- .entry-content -->


</div><!-- .wrap -->
</div><!-- .panel-content -->

